import React from 'react';
import h from './Header.module.css';
import logo from '../image/logo.jpg';

export default class Header extends React.Component {
  render() {
    return (
      <header className={h.header}>
        <div className={h.img}>
          <img src={logo} className={h.img} />
        </div>
      </header>
    );
  }
}
